import React from "react";
import Layout from '../core/Layout';
import {API} from '../config';


const Signup = () =>  (
    <Layout title="Sign Up Page" description="Sign Up to React E-Commerce App">
      {process.env.REACT_APP_API_URL}
    </Layout>
);


export default Signup;
